// App.js
import { useState, useEffect } from "react";

function App() {
  const [data, setData] = useState(null);

  async function fetchData() {
    const endpoint = "http://localhost:8000/things";

    const options = {
      method: "GET",
      headers: { "Content-Type": "application/json" },
    };

    const response = await fetch(endpoint, options);
    const result = await response.json();
    setData(result);
  }

  useEffect(() => {
    fetchData();
  }, []);
  // console.log(data.things[0].description);
  return (
    <main>
      <h1>Basic FARM Stack</h1>

      {data ? (
        <>
          <p>{data.things[0].description}</p>
          <p>dfsdsfs</p>
        </>
      ) : null}

      {data && <p>{data.things[0].description}</p>}
    </main>
  );
}

export default App;
